import './App.css';
import { RouterProvider } from 'react-router-dom';
import routes from './routes/routes';
import store from './redux/store';

function App() {
  return (
    <div>
    <Provider store={store}>
    <RouterProvider router={routes}></RouterProvider>
    </Provider>
    </div>
  );
}

export default App;
